import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { library }  from '@fortawesome/fontawesome-svg-core';
import { faEyeSlash, faEye , faPlusSquare, faTimes } from '@fortawesome/free-regular-svg-icons';

library.add(faEyeSlash, faEye, faPlusSquare, faTimes);

export const EyeSlash = () => <FontAwesomeIcon icon={faEyeSlash}/>;

export const Eye = () => <FontAwesomeIcon icon={faEye}/>;

export const PlusSign = () => <FontAwesomeIcon icon={faPlusSquare} size='lg'/>

export const Times = () => <FontAwesomeIcon icon={faTimes} />
